import React, { useState } from 'react';
import { Button, Label } from 'reactstrap';

import './CodeToggle.css';


const CodeToggle = () => {

  return (
    <div className="CodeToggle-container">

      <Label>Active codes</Label>
      <div>
        <Button>+</Button>
      </div>

    </div>
  );
}

export default CodeToggle;
